import React, { PureComponent } from "react";
import AddUser from "./Components/AddUser";
import "./App.css";

class User extends PureComponent {
  constructor() {
    super();
    this.state = {
      fetchedData: [],
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData() {
    fetch({url: "http://localhost:8081/user", mode:"no-cors"})
      .then((res) => res.body())
      .then((fetchedData) => {
        console.log(fetchedData);
        this.setState({ fetchedData });
      });
  }

  render() {
    return (
      <div>
        <AddUser />
        {this.state.fetchedData}
      </div>
    );
  }
}

export default User;
